INSERT INTO public.infoprodi VALUES (1, 'Teknik Elektronika', 'Teknik elektronika (Electronic Engineering) adalah subdisiplin teknik elektro (Electrical Engineering) yang muncul pada awal abad ke-20 dan mempunyai ciri dengan penggunaan tambahan komponen aktif seperti perangkat semikonduktor untuk memperkuat dan mengontrol aliran arus listrik. Sebelumnya teknik elektro hanya menggunakan perangkat pasif seperti saklar mekanik, resistor, induktor dan kapasitor.');
INSERT INTO public.infoprodi VALUES (2, 'Teknik Telekomunikasi', 'Program studi Teknik Telekomunikasi Politeknik Elektronika Negeri Surabaya, didirikan atas dasar besarnya kebutuhan masyarakat akan lulusan yang memiliki pengetahuan dan kemampuan dalam bidang Sistem Telekomunikasi. Program studi Teknik Telekomunikasi menyelenggarakan proses pendidikan yang berkualitas dengan menyelenggarakan suasana akademik yang kondusif untuk meningkatkan mutu pendidikan di bidang Jaringan Telekomunikasi. Program pendidikan yang diselenggarakan adalah Program Ahli Madya (3 tahun) dan Program Sarjana Terapan (4 tahun).');
INSERT INTO public.infoprodi VALUES (3, 'Teknik Elekro Industri', 'Teknik Elektronika Industri mendidik peserta didik agar memiliki kemampuan / keterampilan pada bidang sistem kontrol dan maintenance peralatan industri berbasis “electrical control”, instrumentasi kendali dan otomasi.');
INSERT INTO public.infoprodi VALUES (4, 'Teknik Informatika', 'Lulusan Program Studi Teknik Informatika dibekali dengan kemampuan dan keahlian teknis, agar memiliki kompetensi di bidang pemrograman komputer, pembangunan sistem informasi dan teknologi basis data, pengembangan rekayasa perangkat lunak baik pada perangkat desktop, web maupun mobile, serta jaringan komputer. Selain kemampuan teknis, Lulusan Program Studi Teknik Informatika juga dibekali dengan kemampuan non teknis(soft skill), berupa pengetahuan dan wawasan kehidupan sosial dan beragama, mendukung gerakan anti-korupsi, kepemimpinan, etika dan ketrampilan komunikasidalam membina kerjasama yang baik sesuai kebutuhan lapangan kerja, sehingga menjadi lulusan yang memiliki kualitas dan integritas intelektual dengan karakter Jujur, Orisinil, Semangat, dan Santun.');
INSERT INTO public.infoprodi VALUES (5, 'Teknik Mekatronika', 'Mekatronika adalah suatu ilmu yang mengkombinasikan secara sinergis rekayasa mekanika, elektronika, dan kontrol. Teknik Mekatronika di Politeknik Elektronika Negeri Surabaya (PENS) adalah program studi yang menggabungkan teknik mesin, elektronika, dan komputer. Program studi ini berada di Departemen Teknik Mekanika Energi (DTME).');
INSERT INTO public.infoprodi VALUES (6, 'Teknik Komputer', 'Teknik Komputer adalah sebuah program studi yang mengintegrasikan teknik elektro dan ilmu komputer dalam mengembangkan sistem perangkat keras (hardware), perangkat lunak (software), dan jaringan komputer (network). Disini yang akan di pelajari adalah bagaimana merancang dan membangun “otak” dari komputer atau alat elektronik lainnya yang akan mengontrol jalannya sistem. Bentuk dari “otak” komputer tersebut adalah processor atau chip yang terdapat dalam motherboard. FYI, processor atau chip ini lah yang akan memroses instruksi atau aktivitas dari hardware (misalnya menekan tombol pada keyboard, atau mengeklik mouse), yang kemudian disimpan dalam memory, dan di operasikan dengan algoritma. Pada program studi ini juga akan mempelajari pemrograman, namun pemrograman disini lebih ditekankan pada bahasa pemrograman mesin.');
INSERT INTO public.infoprodi VALUES (7, 'Teknologi Multimedia dan Broadcasting', 'Program studi D3 Teknologi Multimedia dan Broadcasting merupakan salah satu program studi di bawah naungan Departemen Teknologi Multimedia Kreatif – PENS. Prodi yang berdiri sejak tahun 2008 ini dikenal juga dengan sebutan D3 MMB. Melalui pendidikan di program studi D3 Teknologi Multimedia dan Broadcasting mahasiswa akan mendapatkan pengetahuan tentang elektronika umum, sistem pemancar radio dan televisi, sistem studio siaran radio dan TV, tools untuk pengembangan konten multimedia seputar animasi 2D/3D, editing foto/video, penggunaan kamera, lighting, dan untuk segi broadcasting-nya melalui jaringan internet. Lulusan dari program studi D3 MMB akan mampu terlibat dalam pekerjaan terkait pengoperasikan dan pemeliharaan fasilitas broadcasting dan peralatan-peralatan di stasiun pemancar radio ataupun televisi, atau di industri media yang lain.');
INSERT INTO public.infoprodi VALUES (8, 'Sistem Pembangkitan Energi', 'Sistem Pembangkit Energi (SPE) merupakan disiplin ilmu yang mempelajari proses konversi dan pembangkitan energi khususnya energi listrik. Dengan mempelajari konsep dasar termodinamika dan rangkaian listrik sebagai salah satu aspek penting dalam analisis teknik diharapkan menjadi dasar dalam pengembangan bidang kelistrikanan dan energi. Dengan kata lain, Program Studi SPE membekali mahasiswa dengan penguasaan ilmu dan pengetahuan tentang konversi energi secara mendalam.');
INSERT INTO public.infoprodi VALUES (9, 'Teknologi Game', 'Dalam Program Studi D4 Teknologi Game, mahasiswa akan dibekali dengan kemampuan dasar yang dapat mendukung perkembangan industri game yaitu di bidang teknis, bidang desain, bidang social komunikasi, dan bidang bisnis untuk melakukan usaha di bidang industri game. Program studi ini ingin membentuk mahasiswa yang berkemampuan teknis meliputi merancang dan membuat game, menguasai pemrograman komputer khususnya yang berhubungan dengan game seperti kemanpuan grafik dan audio, penguasaan library dan tools dengan konsep yang kuat menghasilkan kemampuan membuat game platform dan game engine yang dibutuhkan untuk memasukkan konten lokal. Prodi D4 Teknologi Game ini bergerak dalam mengembangkan Industri Kreatif.');
INSERT INTO public.infoprodi VALUES (10, 'Teknologi Rekayasa Internet', 'Sarjana Terapan Teknologi Rekayasa Internet akan mendapatkan materi teori dan praktek tentang elektronika umum, pengembangan aplikasi website, network security, cloud computing, mobile computing, dan Internet of Things (IoT). Dengan dosen yang berpengalaman dalam akademik dan praktisi, maka lulusan akan memiliki kompetensi antara lain Internet Developer, Internet Network Engineer, Network Security Engineer, Cloud Computing Engineer, Mobile dan IoT Engineer, dan masih banyak lainnya.');
INSERT INTO public.infoprodi VALUES (11, 'Teknologi Rekayasa Multimedia', 'Prodi TRM berfokus pada ilmu terapan yang berhubungan dengan semua teknologi yang digunakan untuk memproses informasi yang diekspresikan pada media digital berupa teks, grafik, animasi, video on demand (VOD), dan juga musik.');
INSERT INTO public.infoprodi VALUES (12, 'Sains Data Terapan', 'Sains Data (Data Science) adalah sebuah ilmu terapan yang menganalisis serta mempelajari wawasan dari banyak data, baik terstruktur atau tidak terstruktur. Ilmu sains data ini adalah bidang ilmu gabungan mulai dari statistika, bisnis dan ilmu komputer. Melalui program studi Sains Data Terapan di Politeknik Elektronika Negeri Surabaya ini mahasiswa akan mendapatkan pengetahuan secara mendalam di bidang Domain Bisnis, Matematika dan Statistik, Ilmu Komputer (Kecerdasan Buatan), serta bidang Komunikasi.');
